  return (
    <Container fluid>
      <Breadcrumb className="my-4">
        <Breadcrumb.Item>Home</Breadcrumb.Item>
        <Breadcrumb.Item>{detail.title}</Breadcrumb.Item>
      </Breadcrumb>
      <Row>
          <Col lg={7}>

          </Col>
          <Col lg={5}>

          </Col>
      </Row>
    </Container>
  );
}

export default ListingDetail;
